// src/components/RegionStats.js
import React from 'react';

const RegionStats = () => {
  return (
    <div style={{
      padding: '1rem',
      backgroundColor: '#fff',
      border: '1px solid #eee',
      borderRadius: '8px',
      marginBottom: '1rem'
    }}>
      <h3>Mount Pleasant</h3>
      <p><strong>$320,000</strong> Avg. Rent</p>
      <p><strong>$2,700/mo</strong> Current Rate</p>
      <p><strong>2.8%</strong> Vacancy</p>
      <p><strong>3.2</strong> Break & Enter Rate</p>
      <p><strong>56</strong> Dev Permits (YTD)</p>
    </div>
  );
};

export default RegionStats;
